import React from 'react';

class HomeBigButton extends React.Component {

    constructor(props) {
        super(props);
    }    

    render(){
        return (
            <div className={this.props.ownClass} onClick={()=>{this.props.callback}}>
                <div className="text-button">{this.props.label}</div>
            </div>
        );
    }
}

